    margin-left: 35px;
}

.header .header__img .header__img__share{
    position: absolute;
    top: 60px;
    right: 0%;
    align-items: center ;
    justify-content: space-around;
    width: 360px;

}
.header__img .header__img__share .imgshare{
    
   
}
.header__img .header__img__share .imgshare i{
    margin-right: 5px;
    background: #313a47;
    width: 35px;
    height: 35px;
    font-size: 14px;
    line-height: 35px;
    border-radius: 50%;
    text-align: center;
    margin-left: 5px;
}
.header__img .header__img__share .imgshare .img__calendare{
    color: white;
   margin-top: 10px;
   font-size: 14px;
   margin-left: 10px;
   
}
     
   .color{
